import React from 'react';

function ProgressBar(props){
    return(
        <div>
            <p className="d-inline custom-bar-label lead">{props.label}</p>
            <div className="completed-bar">
                <div className="custom-bar" style={{ width: `${props.percent}` }} >

                    <span className="custom-bar-label-secondary">{props.years}</span>

                </div>

            </div>
            <br/>
        </div>

    );
}

export default ProgressBar;
